description:
DJ 아빠와 가족 드라마를 찍어가며 세계적인 DJ로 성장한 화이트 폴!! 세계가 우리 무대! DJ들의 EDM을 향한 열정과 삶을 담은 일상 드라마. 과연 이들은 예상치 못한 새로운 갖가지 갈등을 극복하고 꿈을 이어나갈 수 있을 것인가? 

*EDM: Electronic Dance Music(일렉트로닉 댄스 뮤직)
// 자유 연재 중

